આપણે $5+\sqrt{3}$ નું વર્તું નું વર્તું કરીએ: \begin{align*}
(5+\sqrt{3})(5-\sqrt{3})&=5^2-(\sqrt{3})^2\\
&=25-3\\
&=\boxed{22}.
\end{align*}

